import logo from './logo.svg';
import './App.css';
import ScatterPlot from './Plot.js';

const chartData = [
  {"elicitation" : "heed", "f1" : 310, "f2" : 1933},
  {"elicitation" : "hard", "f1" : 667, "f2" : 1056},
  {"elicitation" : "hood", "f1" : 444, "f2" : 880},
]

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <div>
        <ScatterPlot data={chartData} />
      </div>
    </div>
  );
}

export default App;
